import React from "react";
import { Nav, NavLink, NavMenu } 
    from "./NavbarElements";
  
const Navbar = () => {
  const openInNewTab = url => {
    window.open(url, '_blank', 'noopener,noreferrer');
  };
  return (
    <>
      <Nav>
        <NavMenu>
          
        <NavLink to="/Espace_administration" activeStyle onClick={() => openInNewTab("/Espace_Administration")}>
            Espace Administration 
          </NavLink>
            
          
          <NavLink to="/Espace_j" activeStyle onClick={() => openInNewTab('/Espace_Jurys')}>
            Espace Jurys 
          </NavLink>
          <NavLink to="/" activeStyle>
           Espace Superviseur 
          </NavLink>
          <NavLink to="/" activeStyle> 
          Home 
          </NavLink>
          
        </NavMenu>
      </Nav>
    </>
  );
};
  
export default Navbar;
